import React from "react";

function Favorites() {
  console.log("✅ Favorites page loaded!"); // Debugging log

  return (
    <div className="favorites-container">
      <h1>❤️ Your Favorite Articles</h1>
      <p>Saved articles will appear here.</p>
    </div>
  );
}

export default Favorites;
